import React from 'react';
import styled from 'styled-components';

export const ProfilePicture = styled.img`
    max-width: 300px;
    min-width: 16px; 
    width: 10rem;    
    border-radius: 50%;    
    border: 2px solid var(--primary);
    padding: 5px;
    aligne: center;
`;
